import React, {useEffect, useState} from 'react';
import * as yup from 'yup';
import {
    MDBBtn,
    MDBContainer,
    MDBCard,
    MDBCardBody,
    MDBCardImage,
    MDBRow,
    MDBCol,
    MDBIcon,
    MDBInput
}
    from 'mdb-react-ui-kit';
import {ErrorMessage, Field, Form, Formik} from "formik";
import {useNavigate} from "react-router-dom";
import {saveMerchant} from "../service/MerchantService";

function FormRegister() {
    let navigate = useNavigate();
    const [merchant, setMerchant] = useState({
        activity: {
            id_activity: 3
        },
        name: '',
        phone: '',
        email: '',
        open_time: '',
        close_time: '',
        address_shop: {
            city: {
                id_city: ''
            },
            district: {
                id_district: ''
            },
            ward: {
                id_ward: ''
            },
            address_detail: ''
        },
        image: ''
    });

    const handleCreateMerchant = () => {
        saveMerchant(merchant).then(r => {
                alert("ok");
                navigate('/')
            }
        ).catch( () => {
            alert('error')
            navigate('/register')
        }
    )
    }
    const schema = yup.object().shape({
        name: yup.string().required(),
        phone: yup.number().positive().integer().required().test(
            val => val && val.toString().length === 10),
        email: yup.string().matches(/^[A-Za-z0-9._-]+@[A-Za-z]+\.[A-Za-z]{2,}$/),
        open_time: yup.date().required,
        close_time: yup.date().required
    });

    return (
        <MDBContainer className="my-5">

            <MDBCard>
                <MDBRow className='g-0'>

                    <MDBCol md='6'>
                        <MDBCardImage style={{height : '600px'}}
                            src='https://firebasestorage.googleapis.com/v0/b/react-firebase-storage-f6ec9.appspot.com/o/file%2FdoAnNgon.jpg?alt=media&token=e3c3377c-463d-481d-bb04-ba2d890e27b9'
                            alt="register form" className='rounded-start w-100'/>
                    </MDBCol>

                    <MDBCol md='6'>
                        <MDBCardBody className='d-flex flex-column'>

                            <div className='d-flex flex-row mt-2'>
                                <MDBCardImage style={{height : '50px', width: '170px'}} src='https://firebasestorage.googleapis.com/v0/b/react-firebase-storage-f6ec9.appspot.com/o/file%2Flogo--web.png?alt=media&token=372f9a0c-25f3-4f56-9019-21ba8c8e607a'
                                 alt="logo form"/>
                            </div>

                            <h5 className="fw-normal my-4 pb-3" style={{letterSpacing: '1px', fontWeight: 'bolder'}}>Register Merchant</h5>

                                <div style={{width: "500px", margin: 'auto'}}>
                                    <h2 style={{ textAlign: 'center', marginTop: '10px' }}>Register</h2>
                                    <Formik initialValues={merchant} onSubmit={handleCreateMerchant}>
                                        <Form>
                                            <div className="mb-3">
                                                <label className="form-label">Name</label>
                                                <Field className="form-control" name="name" />
                                                <ErrorMessage name="name" component="div" className="error" />
                                            </div>
                                            <div className="mb-3">
                                                <label className="form-label">Phone</label>
                                                <Field type="number" className="form-control" name="phone" />
                                                <ErrorMessage name="phone" component="div" className="error" />
                                            </div>
                                            <div className="mb-3">
                                                <label className="form-label">Email</label>
                                                <Field type="email" className="form-control" name="email" />
                                                <ErrorMessage name="email" component="div" className="error" />
                                            </div>
                                            <div className="mb-3">
                                                <label className="form-label">Open Time</label>
                                                <Field type="time" className="form-control" name="open_time" />
                                                <ErrorMessage name="open_time" component="div" className="error" />
                                            </div>
                                            <div className="mb-3">
                                                <label className="form-label">Close Time</label>
                                                <Field type="time" className="form-control" name="close_time" />
                                                <ErrorMessage name="close_time" component="div" className="error" />
                                            </div>
                                            <button type="submit" className="btn btn-primary">
                                                Submit
                                            </button>
                                        </Form>
                                    </Formik>
                                </div>

                            <MDBBtn className="mb-4 px-5" color='dark' size='lg'>Login</MDBBtn>

                            <div className='d-flex flex-row justify-content-start'>
                                <a href="#!" className="small text-muted me-1">Terms of use.</a>
                                <a href="#!" className="small text-muted">Privacy policy</a>
                            </div>

                        </MDBCardBody>
                    </MDBCol>

                </MDBRow>
            </MDBCard>

        </MDBContainer>
    );
}

export default FormRegister;
